" <!-- TC:TOPIC_PAGE -->",
" <div id=\"topicContent\">",
"  <div id=\"drugTitle\">",
"   Fludeoxyglucose F-18: Drug information",
"  </div>",
"  <div id=\"lexiTitleImg\">",
"   <img height=\"17\" src=\"./../images/lexiComp/Lexicomp_2012_71x17.myextg\" width=\"71\"/>",
"  </div>",
"  <div class=\"clear\">",
"  </div>",
"  <div id=\"drugCopy\">",
"   Copyright 1978-2013 Lexicomp, Inc. All rights reserved.",
"  </div>",
"  <div id=\"topicText\">",
"   (For additional information",
"   <a class=\"drug drug_patient\" href=\"UTD.htm?8/33/8723?source=see_link\">",
"    see \"Fludeoxyglucose F-18: Patient drug information\"",
"   </a>",
"   )",
"   <br/>",
"   For abbreviations and symbols that may be used in Lexicomp (",
"   <a class=\"graphic graphic_table\" href=\"UTD.htm?23/39/24183\">",
"    show table",
"   </a>",
"   )",
"   <div class=\"ex_sect_xr thclist drugH1Div drugBrandNames\" id=\"F13172595\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacologic Category",
"    </span>",
"    <ul>",
"     <li>",
"      Radiopharmaceutical",
"     </li>",
"    </ul>",
"   </div>",
"   <div class=\"block doa drugH1Div\" id=\"F13172699\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Adult",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     PET scan should be done within 40 minutes of administration.",
"    </p>",
"    <p style=\"text-indent:0em;\">",
"     I.V. (based on 70 kg patient): 5-10 mCi (185-370 MBq)",
"    </p>",
"   </div>",
"   <div class=\"block dop drugH1Div\" id=\"F13172698\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Pediatric",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     <b>",
"      Note:",
"     </b>",
"     PET scan should be done within 40 minutes of administration.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     I.V.: Doses as low as 2.6 mCi have been given; however, dosing strategies have not been confirmed.",
"    </p>",
"   </div>",
"   <div class=\"block dor drugH1Div\" id=\"F15881450\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Renal Impairment",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No dosage adjustment provided in manufacturer's labeling (has not been studied).",
"    </p>",
"   </div>",
"   <div class=\"block doh drugH1Div\" id=\"F15881451\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Dosing: Hepatic Impairment",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     No dosage adjustment provided in manufacturer's labeling (has not been studied).",
"    </p>",
"   </div>",
"   <div class=\"block use drugH1Div\" id=\"F13172458\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Use",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Fluorinated deoxyglucose used in conjunction with positron emission tomography (PET) to detect areas in the brain with abnormal glucose metabolism linked with foci of epileptogenic seizures",
"    </p>",
"   </div>",
"   <div class=\"block mst drugH1Div\" id=\"F13255249\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Medication Safety Issues",
"    </span>",
"    <div class=\"collapsible\">",
"     <span class=\"collapsible-title\">",
"      Other safety concerns:",
"     </span>",
"     <div class=\"collapsible-wrap\">",
"      <p style=\"text-indent:-2em;margin-left:4em;\">",
"       Radiopharmaceutical: Use appropriate precaution for handling, disposal, and minimizing exposure to patients and healthcare personnel. Use under supervision of experienced personnel. Should be stored in original lead container or adequate radiation shield.",
"      </p>",
"     </div>",
"    </div>",
"   </div>",
"   <div class=\"block ars drugH1Div\" id=\"F13172687\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Adverse Reactions Significant",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     &gt;10%: Endocrine &amp; metabolic: Hyper-/hypoglycemia (14%)",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     1% to 10%:",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Cardiovascular: Transient hypotension",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     Hepatic: Transient alkaline phosphatase increased",
"    </p>",
"   </div>",
"   <div class=\"block war drugH1Div\" id=\"F13172507\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Warnings/Precautions",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;\">",
"     <b>",
"      <i>",
"       Special handling:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Radiopharmaceutical: Use appropriate precautions for handling, disposal, and minimizing exposure to patients and healthcare personnel. Use only under supervision of individuals who have received training in the handling of radioactive materials and who are authorized by the applicable regulatory authority.",
"    </p>",
"    <p style=\"text-indent:0em;\">",
"     <b>",
"      <i>",
"       Disease-related concerns:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Diabetes mellitus: Uptake may be changed, and patients may need blood glucose stabilization prior to and following administration.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     <b>",
"      <i>",
"       Other warnings/precautions:",
"      </i>",
"     </b>",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Monitoring: Patients should be monitored for arrhythmias.",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:4em;\">",
"     &bull; Patient information: Patients should fast the day before treatment.",
"    </p>",
"   </div>",
"   <div class=\"block prf drugH1Div\" id=\"F13172516\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Risk Factor",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     C (",
"     <a class=\"graphic graphic_table\" href=\"UTD.htm?16/42/17068\">",
"      show table",
"     </a>",
"     )",
"    </p>",
"   </div>",
"   <div class=\"block pri drugH1Div\" id=\"F13172517\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pregnancy Implications",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Animal studies have not been conducted. There are no adequate and well-controlled studies in pregnant women. Radiopharmaceuticals have the potential to cause fetal harm. Use during pregnancy only if clearly needed.",
"    </p>",
"   </div>",
"   <div class=\"block lac drugH1Div\" id=\"F13172518\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Lactation",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Excretion in breast milk unknown/use caution",
"    </p>",
"   </div>",
"  </div>",
